import React, { useState } from 'react';
import './VideoLibrary.css';

const VideoLibrary = () => {
  const [selectedDifficulty, setSelectedDifficulty] = useState('all');

  const videoData = {
    "ChessMaster Academy": [
      {
        id: 1,
        title: "Control the Center",
        duration: "12:34",
        difficulty: "beginner",
        thumbnail: "â™Ÿï¸",
        description: "Learn the fundamental principle of controlling the center squares in chess."
      },
      {
        id: 2,
        title: "King Safety in the Opening",
        duration: "15:20",
        difficulty: "beginner",
        thumbnail: "ðŸ‘‘",
        description: "Essential techniques to keep your king safe during the opening phase."
      },
      {
        id: 3,
        title: "The Italian Game Masterclass",
        duration: "28:45",
        difficulty: "intermediate",
        thumbnail: "ðŸ‡®ðŸ‡¹",
        description: "Deep dive into one of the most popular and effective chess openings."
      },
      {
        id: 4,
        title: "Sicilian Defense Fundamentals",
        duration: "22:15",
        difficulty: "intermediate",
        thumbnail: "âš”ï¸",
        description: "Master the most dynamic and complex chess defense system."
      }
    ],
    "Tactical Patterns": [
      {
        id: 5,
        title: "Pin and Skewer Tactics",
        duration: "18:30",
        difficulty: "beginner",
        thumbnail: "ðŸ“Œ",
        description: "Learn to use pins and skewers to win material and gain advantages."
      },
      {
        id: 6,
        title: "Fork Combinations",
        duration: "14:45",
        difficulty: "beginner",
        thumbnail: "ðŸ´",
        description: "Master the art of forking pieces to create tactical opportunities."
      },
      {
        id: 7,
        title: "Discovered Attacks",
        duration: "20:10",
        difficulty: "intermediate",
        thumbnail: "ðŸ’¥",
        description: "Unleash powerful discovered attacks by moving pieces strategically."
      },
      {
        id: 8,
        title: "Advanced Tactical Motifs",
        duration: "35:20",
        difficulty: "advanced",
        thumbnail: "ðŸ§©",
        description: "Complex tactical combinations and advanced attacking patterns."
      }
    ],
    "Endgame Mastery": [
      {
        id: 9,
        title: "Basic King and Pawn Endings",
        duration: "25:15",
        difficulty: "beginner",
        thumbnail: "â™Ÿï¸",
        description: "Essential endgame principles for king and pawn scenarios."
      },
      {
        id: 10,
        title: "Rook Endgames",
        duration: "32:40",
        difficulty: "intermediate",
        thumbnail: "â™œ",
        description: "Master the most common and important endgame type in chess."
      },
      {
        id: 11,
        title: "Queen vs Pawn Endings",
        duration: "19:25",
        difficulty: "intermediate",
        thumbnail: "â™•",
        description: "Learn when and how to win or draw these critical endgames."
      },
      {
        id: 12,
        title: "Complex Endgame Studies",
        duration: "45:30",
        difficulty: "advanced",
        thumbnail: "ðŸŽ¯",
        description: "Advanced endgame techniques and complex winning methods."
      }
    ],
    "Strategic Concepts": [
      {
        id: 13,
        title: "Pawn Structure Basics",
        duration: "21:50",
        difficulty: "intermediate",
        thumbnail: "ðŸ—ï¸",
        description: "Understand how pawn structure affects the entire game."
      },
      {
        id: 14,
        title: "Piece Activity and Coordination",
        duration: "26:35",
        difficulty: "intermediate",
        thumbnail: "ðŸ¤",
        description: "Learn to coordinate your pieces for maximum effectiveness."
      },
      {
        id: 15,
        title: "Weak Squares and Outposts",
        duration: "18:40",
        difficulty: "intermediate",
        thumbnail: "ðŸŽ¯",
        description: "Identify and exploit weak squares and outpost opportunities."
      },
      {
        id: 16,
        title: "Strategic Planning",
        duration: "38:20",
        difficulty: "advanced",
        thumbnail: "ðŸ“‹",
        description: "Develop long-term strategic plans and execute them effectively."
      }
    ]
  };

  const handleVideoClick = (video) => {
    // In a real application, this would open the video player
    alert(`Playing: ${video.title}\nDuration: ${video.duration}\nDifficulty: ${video.difficulty}\n\n${video.description}`);
  };

  const getDifficultyColor = (difficulty) => {
    switch (difficulty) {
      case 'beginner': return 'difficulty-beginner';
      case 'intermediate': return 'difficulty-intermediate';
      case 'advanced': return 'difficulty-advanced';
      default: return 'difficulty-beginner';
    }
  };

  const filterVideos = (videos) => {
    if (selectedDifficulty === 'all') return videos;
    return videos.filter(video => video.difficulty === selectedDifficulty);
  };

  return (
    <div className="video-library">
      <section className="hero-section">
        <div className="container">
          <h1>Chess Video Library</h1>
          <p>Master chess with our comprehensive collection of instructional videos</p>
        </div>
      </section>

      <section className="section">
        <div className="container">
          <div className="filters">
            <h3>Filter by Difficulty:</h3>
            <div className="difficulty-filters">
              <button
                className={`filter-btn ${selectedDifficulty === 'all' ? 'active' : ''}`}
                onClick={() => setSelectedDifficulty('all')}
              >
                All Levels
              </button>
              <button
                className={`filter-btn ${selectedDifficulty === 'beginner' ? 'active' : ''}`}
                onClick={() => setSelectedDifficulty('beginner')}
              >
                Beginner
              </button>
              <button
                className={`filter-btn ${selectedDifficulty === 'intermediate' ? 'active' : ''}`}
                onClick={() => setSelectedDifficulty('intermediate')}
              >
                Intermediate
              </button>
              <button
                className={`filter-btn ${selectedDifficulty === 'advanced' ? 'active' : ''}`}
                onClick={() => setSelectedDifficulty('advanced')}
              >
                Advanced
              </button>
            </div>
          </div>

          {Object.entries(videoData).map(([category, videos]) => {
            const filteredVideos = filterVideos(videos);
            if (filteredVideos.length === 0) return null;

            return (
              <div key={category} className="category-section">
                <h2 className="category-title">{category}</h2>
                <div className="video-grid">
                  {filteredVideos.map((video) => (
                    <div
                      key={video.id}
                      className="video-card"
                      onClick={() => handleVideoClick(video)}
                    >
                      <div className="video-thumbnail">
                        {video.thumbnail}
                      </div>
                      <div className="video-info">
                        <h3 className="video-title">{video.title}</h3>
                        <div className="video-meta">
                          <div className="video-duration">
                            <svg width="16" height="16" viewBox="0 0 24 24" fill="currentColor">
                              <path d="M12 2C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm-2 15l-5-5 1.41-1.41L10 14.17l7.59-7.59L19 8l-9 9z"/>
                            </svg>
                            {video.duration}
                          </div>
                          <span className={`difficulty-badge ${getDifficultyColor(video.difficulty)}`}>
                            {video.difficulty}
                          </span>
                        </div>
                        <p className="video-description">{video.description}</p>
                      </div>
                    </div>
                  ))}
                </div>
              </div>
            );
          })}
        </div>
      </section>
    </div>
  );
};

export default VideoLibrary;
